import logo from './logo.svg';
import React from "react"
import './App.css';
import button from './components/button.js';
import calculator from './components/calculator.js';
import calculatortitle from './components/calculatortitle.js';
import outputscreen from './components/outputscreen.js';
import ouputscreenrow from './components/outputscreenrow.js';


class app extends React.Component{
  render(){
      return(
          <div classname="frame">
              <claculatortitle value= "Calculator" />
              <div class="maincalc">
                  <outputscreen />
                  <div classname="buttonrow">
                      <button label={"Clear"} />
                      <button label={"Delete"} />
                      <button label={"."} />
                      <button label={"/"} />
                  </div>
                  <div classname="buttonrow">
                      <button label={"7"} />
                      <button label={"8"} />
                      <button label={"9"} />
                      <button label={"*"} />
                  </div>
                  <div classname="buttonrow">
                      <button label={"4"} />
                      <button label={"5"} />
                      <button label={"6"} />
                      <button label={"-"} />
                  </div>
                  <div classname="buttonrow">
                      <button label={"1"} />
                      <button label={"2"} />
                      <button label={"3"} />
                      <button label={"+"} />
                  </div>
                  <div classname="buttonrow">
                      <button label={"0"} />
                      <button label={"="} />
                  </div>
              </div>
          </div>
      );
  }
}
export default app;
